description:
Bianca Taylor Ryan (born September 1, 1994) is an American singer and guitarist, who won the debut season of NBC's America's Got Talent at age 11.
Ryan's self-titled first CD was recorded just after her 12th birthday and released on November 14, 2006; Bianca Ryan broke into the Billboard 200 at #57. One month later, the EP Christmas Everyday! was released as a promotional giveaway.
She has since performed in such countries as Australia and Switzerland. Her first concert tour took her across the United States as the &quot;special guest&quot; artist for Live Nation's Nextfest.

